select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1569082960,message={id=0,msg=""},news={{title="Classic Pricing Data is now available through the TSM Application!",content="We've been hard at work setting up the infrastructure to process and distribute pricing data through the TSM Desktop Application and are happy to confirm that this is now available for Classic. This functionality relies on your diligent Auction House scanning, so this does not mean that you no longer need to manually scan on [...]",timestamp=1568706063,link="https://blog.tradeskillmaster.com/classic-pricing-data-is-now-available-through-the-tsm-application/"},{title="TradeSkillMaster v4.8.8 Changelog",content="TSM v4.8.8 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added support for enchanting, smelting, and poisons for Classic<br />* Fixed various issues related to Crafting on Classic<br />* Updated disenchant values for both Classic and Retail<br />* Added more detailed disenchant/mill/prospecting information to the tooltip<br />* Fixed various errors seen while using TSM on Classic<br />* Fixed auction durations for Classic<br />* Fixed a few errors caused by incorrect translations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1568655306,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-8-changelog/"},{title="TradeSkillMaster v4.8.7 Changelog",content="TSM v4.8.7 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error caused by a corrupted item cache.<br />* Fixed error when trying to create teh TSM macro on classic.<br />* Fixed positioning of TSM UI button on default UIs in classic.<br />* Fixed bug with cooking not showing properly in classic.<br />* Changed gold graph units from 1kg to 1g on classic.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567627613,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-7-changelog/"},{title="TradeSkillMaster v4.8.6 Changelog",content="TSM v4.8.6 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Made manual AH scan much more reliable on high-pop realms and added progress messages.<br />* Fixed issue with TSM scanning too many pages after doing a manual AH scan on classic.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567404887,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-6-changelog/"},{title="TradeSkillMaster v4.8.5 Changelog",content="TSM v4.8.5 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Removed debug print<br />* Fixed issue with scan failing for some users<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567382245,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-5-changelog/"},{title="TradeSkillMaster v4.8.4 Changelog",content="TSM v4.8.4 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added support for manual AH scanning via the &#8220;/tsm scan&#8221; command<br />* Fixed issue with using Auctioneer prices in TSM<br />* Added support for using AHDB pricing in TSM<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567379642,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-4-changelog/"},{title="TradeSkillMaster v4.8.3 Changelog",content="TSM v4.8.3 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added support for manual AH scanning via the &#8220;/tsm scan&#8221; command<br />* Fixed issue with using Auctioneer prices in TSM<br />* Added support for using AHDB pricing in TSM<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567378718,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-3-changelog/"},{title="TradeSkillMaster Classic Updates",content="It's been somewhat of a turbulent start to Classic WoW, and we have been hard at work to get things right now that we're back at the original Auction House of Azeroth. Here's some of the things we are rolling out from today. Manual Auction House Scans In the mean time, we have been able [...]",timestamp=1567378656,link="https://blog.tradeskillmaster.com/tradeskillmaster-classic-updates/"},{title="TradeSkillMaster v4.8.2 Changelog",content="TSM v4.8.2 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed bug with account syncing not connecting in some situations.<br />* Adjusted default Auctioning operation prices to be invalid if there's no AuctionDB data.<br />* Fixed various errors from cancel scans and generally sped up Auctioning scan processing.<br />* Fixed bug with positioning of merchant frame when using other addons.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1566835284,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-2-changelog/"},{title="TradeSkillMaster v4.8.1 Changelog",content="TSM v4.8.1 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed issues with account syncing.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1566498091,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-1-changelog/"}}}]]) --<APP_INFO,Global,1569082960>
